import style from '../static/Style';
import Counter from '../components/Counter';
import Layout from '../components/Layout';

export default () => (
  <Layout header ="Other" title ="other page.">
    <p>This is Other page.</p>
    <hr />
    <Link href="/">
      <button>
        &lt;&lt; Back to Index page
      </button>
    </Link>
  </Layout>
);
